   const [seqVAL , setSeqVAL] = useState(Array(9).fill(null))

   return (
      <div className="container">
         <div className="rows">
            <Square value = {seqVAL[0]} />
            <Square value = {seqVAL[1]} />
            <Square value = {seqVAL[2]}/>
         </div>

         <div className="rows">

            <Square value = {seqVAL[3]}/>
            <Square value = {seqVAL[4]}/>
            <Square value = {seqVAL[5]}/>

         </div>
         <div className="rows">
            <Square value = {seqVAL[6]}/>
            <Square value = {seqVAL[7]}/>
            <Square value = {seqVAL[8]}/>

         </div>
      </div>
   );
}

export default Board;
